	double RandomGen::genNormal(double miu, double sigma)
    {
        int n = 10000; //normals.Length;
        return normals[Next(n)] * sigma + miu;
    }

	double RandomGen::NextDouble()
	{
		return (double) rand()/(RAND_MAX);
	}

	int RandomGen::Uniform(int min_v, int max_v)
	{
		double tmp_v = (double) rand()/(RAND_MAX);
		tmp_v = tmp_v  * (max_v - min_v) + min_v;
		return (int) tmp_v;
	}

	bool RandomGen::boolUniform(double exp)
	{
		double tmp_v = (double) rand()/(RAND_MAX);
		bool ret = 1;
		//if (tmp_v < 0.5) ret = 0;
		if (tmp_v < ((double) 1 - exp)) ret = 0;
		return ret;
	}
		
	int RandomGen::Next(int max)
	{
		return rand() % max;
	}


